import { useState } from "react";

export default function Homepage() {
    
    const [user, setUser ]= useState({});
    useEffect(() => {
        const token = localStorage.getItem('authToken');
        if (token) {
          const decoded = jwt_decode(token);
          setUser(decoded);
        }
      }, [setUser]);
    return(

        

        <>
       <h1> Homepage </h1> 
        </>

    )
}
